"Meu filho você vai se chama Gabriel tortura vai se polícial e eleitor do Bolsonaro."

@Clouds_Mountain @Joonnarts @leleninist @imafuckingvirgo @karifsg @lehcrd Há muito tempo atrás, pelo menos uns 25 anos. Lembro de relances, minhas tias e mães comentando do horror que era, eu guardei minha mãe dizendo.
" Elas até voaram", mas se falava quase zero do assinto. Me lembro de 1, da q suicidou, uma cara de ódio.
N temos contato.

